const PROFILE_API = 'http://localhost:5000/rest/restaurantsService';

export const fetchAllRestaurants = (dispatch) =>
    fetch(PROFILE_API)
        .then(response => response.json())
        .then(restaurants =>
            dispatch({
                type: 'fetch-all-restaurants',
                fetchAllRestaurants
            })
        );
